class PaymentService{

    getPaymentTypes = () => {
            return fetch("http://localhost:8080/dealbazzar/fetchPaymentType")
        }


    addPayment=(payment,bidId)=>{
        console.log("payment: ",payment,"bidId: ",bidId)
        return fetch(`http://localhost:8080/dealbazzar/payment/${bidId}`,{
            method: "POST",
            headers: {
                "Content-Type": "application/json"
            },
            body: JSON.stringify(payment)
        })
    }

}

var obj = new PaymentService()
export default obj;
